import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function App() {
  return(
    <div>
      <Header />
      <PatronForm />
      <Result />
    </div>
  )
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
);
